	(1,28,'Innova con Certificación VPS','innova-con-certificacion-vps','','','<a id=\"content-title\">volvo suecia car minerva innova con certificacón vps</a>','<p class=\"post-paragraph\" id=\"container-paragraph\">Volvo Suecia Car Minerva se posicionó como el primer Distribuidor Autorizado Volvo en contar con la certificación VPS (Volvo Personal Service)</p>\n','<p>Volvo Suecia Car Minerva se posicionó como el primer Distribuidor Autorizado Volvo en contar con la Certificación VPS (Volvo Personal Service)  a nivel México y Latinoamérica, un nuevo concepto de taller de nivel superior.</p>','<p>Volvo Personal Service es un sistema de atención personalizada que reinventó la idea de ir al taller, pues es mucho más cómodo, rápido y confiable. El cliente hace una cita, llega al taller y lo que usualemente podría tomar dos horas o hasta días en ser reparado, queda resuleto en menos de una hora; tiempo que el cliente puede disfrutar en la sala de espera con una debida de cortesía o bien, puede observar la reparación mientras el equipo de técnicos le explica paso a paso qué necesita.</p>','<h3 class=\"post-subtitle\">VPS</h3>','news_volvo.jpg','news_volvo2.jpg','<blockquote>\n                                <p>\n                                    Volvo Cars tiene proyectado capacitar a todos los Distribuidores Autorizados Volvo de Latinoamérica, para que cuenten con la certificación Volvo Personal Service antes del 2017.\n                                </p>\n                            </blockquote>','','Volvo Suecia Car Minerva','volvo-suecia-car-minerva','small_volvo.jpg','','','Sábado 23 de Mayo de 2015','<section class=\"\" style=\"padding: 35px 15px 15px;\">\n        <div class=\"row\">\n\n            <div class=\"col-md-4 col-sm-4 text-center\">\n                <img src=\"../img/sitio/agencias/logos/logo_suecia_car_minerva_txt.png\" alt=\"SUECIA CAR MINERVA\" class=\"x-img x-img-none none agn_logo\">\n                <img src=\"../img/sitio/agencias/logos/logo_volvo.png\" alt=\"VOLVO\" class=\"x-img x-img-none none agn_logo\">\n            </div>\n            <div class=\"col-md-8 col-sm-8 text-left\" style=\"font-size: 16px; padding: 20px 5px 0px;\">\n                <div class=\"contact-method\">\n                    <i class=\"icon pe-7s-phone agn_icono\"></i>\n                    <span class=\"agn_span\">(33) 3208-8080</span>\n                </div>\n\n                <div class=\"contact-method\">\n                    <i class=\"icon pe-7s-map-marker agn_icono\"></i>\n                    <span class=\"agn_span\">\n                        Av. Vallarta No. 2750, Col. Arcos Sur, Guadalajara, Jal. CP 44150.\n                    </span>\n                </div>\n\n                <div class=\"contact-method\">\n                    <i class=\"icon pe-7s-clock agn_icono\"></i>\n                    <span class=\"agn_span\">\n                        <strong>Ventas:</strong> 09:00-20:00 <br>\n                        <strong>Servicio:</strong> 08:00-19:00\n                    </span>\n                </div>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-md-12 text-center\" style=\"padding: 20px;\">\n                <a href=\"http://www.sueciacarminerva.com/\" class=\"button py4 button-transparent bg-youtube resp-button\" target=\"_blank\">\n                    <i class=\"fa fa-globe fa-fw fa-lg\"></i> SITIO WEB\n                </a>\n                <a href=\"https://www.facebook.com/sueciacarguadalajaraminerva\" class=\"button py4 button-transparent bg-facebook resp-button\" target=\"_blank\">\n                    <i class=\"fa fa-facebook fa-fw fa-lg\"></i> FACEBOOK\n                </a>\n\n            </div>\n        </div>\n    </section>',''),
	(2,16,'Nueva Discovery Sport','nueva-discovery-sport','Diseñado exclusivamente para hoy','small_new_discover_sport.jpg','<a id=\"content-title\">nueva discovery sport diseño exclusivamente para hoy</a>','<p class=\"post-paragraph\" id=\"container-paragraph\">\n                            <b>DISEÑADO EXCLUSIVAMENTE PARA HOY</b> <br> Este es un vehículo moderno, relevante y convincente, tiene una forma compacta, bien proporcionada y postura decidida\n                        </p>','','','','','','','<p>Este es un vehículo moderno, relevante y convincente, tiene una forma compacta, bien proporcionada y postura decidida.</p>\n<p>Su silueta es distinguida y sus superficies están bellamente esculpidas combinándose para crear un vehículo que realmente se conecta a un nivel emocional.</p>','Jaguar Land Rover Guadalajara y Country','jaguar-land-rover-guadalajara-y-country','small_new_discover_sport.jpg','','','25 de Mayo de 2015','<section class=\"\" style=\"padding: 35px 15px 15px;\">\n        <div class=\"row\">\n\n            <div class=\"col-md-4 col-sm-4 text-center\">\n                <h5 style=\"color: #000; text-transform: uppercase;\"><span style=\"color:#7a7a7a;\">LAND ROVER GUADALAJARA Y COUNTRY</span></h5>\n                <img src=\"../img/sitio/agencias/logos/logo_jaguar_land_rover.png\" alt=\"LANDOR ROVER\" class=\"x-img x-img-none none agn_logo\">\n            </div>\n            <div class=\"col-md-8 col-sm-8 text-center\" style=\"font-size: 16px; padding: 20px 5px 0px;\">\n                <a href=\"http://landrovergdl.com.mx/\" class=\"button py4 button-transparent bg-youtube resp-button\" target=\"_blank\">\n                    <i class=\"fa fa-globe fa-fw fa-lg\"></i> SITIO WEB\n                </a>\n                <a href=\"https://www.facebook.com/LandroverGDL\" class=\"button py4 button-transparent bg-facebook resp-button\" target=\"_blank\">\n                    <i class=\"fa fa-facebook fa-fw fa-lg\"></i> FACEBOOK\n                </a>\n            