	(3,16,'Presentación de la nueva Discovery Sport en Guadalajara ','presentacion-nueva-discovery-sport','','news_nueva_discovery_sport_600x400.jpg','<a id=\"content-title\">presentación de la nueva discovery sport en guadalajara</a>','<p class=\"post-paragraph\" id=\"container-paragraph\">\n                            La Triatleta, orgullosamente jalisciense, Begoña Vázquez, se presentó como embajadora de la marca comercial y después de un breve discurso\n                        </p>','','','','','','','<p>El pasado jueves 18 de Junio, se llevó a cabo la presentación del nuevo modelo de camioneta de Land Rover, “Discovery Sport” en las instalaciones de Central Park de la ciudad de Guadalajara.</p>\n                            <p>La Triatleta, orgullosamente jalisciense, Begoña Vázquez, se presentó como embajadora de la marca comercial y después de un breve discurso cedió el micrófono al Director General, el Licenciado José Velázquez, quien habló de las características de la Discovery Sport e invitó a todos los asistentes a presenciar un impresionante show de proyección sobre el mismo.</p>','Jaguar Land Rover Guadalajara y Country','jaguar-land-rover-guadalajara-y-country','news_nueva_discovery_sport_600x400.jpg','https://www.youtube.com/channel/UC-ZX8q42L4v0D_xXc_D4_lg','Canal de Youtube','Jueves 18 de Junio de 2015','<section class=\"\" style=\"padding: 35px 15px 15px;\">\n        <div class=\"row\">\n\n            <div class=\"col-md-4 col-sm-4 text-center\">\n                <h5 style=\"color: #000; text-transform: uppercase;\"><span style=\"color:#7a7a7a;\">LAND ROVER GUADALAJARA Y COUNTRY</span></h5>\n                <img src=\"../img/sitio/agencias/logos/logo_jaguar_land_rover.png\" alt=\"LANDOR ROVER\" class=\"x-img x-img-none none agn_logo\">\n            </div>\n            <div class=\"col-md-8 col-sm-8 text-center\" style=\"font-size: 16px; padding: 20px 5px 0px;\">\n                <a href=\"http://landrovergdl.com.mx/\" class=\"button py4 button-transparent bg-youtube resp-button\" target=\"_blank\">\n                    <i class=\"fa fa-globe fa-fw fa-lg\"></i> SITIO WEB\n                </a>\n                <a href=\"https://www.facebook.com/LandroverGDL\" class=\"button py4 button-transparent bg-facebook resp-button\" target=\"_blank\">\n                    <i class=\"fa fa-facebook fa-fw fa-lg\"></i> FACEBOOK\n                </a>\n            </div>\n        </div>\n    </section>',''),
	(4,42,'Gran Inauguración de Tyre Plus 17 de Agosto','gran-inauguracion','','Tyre_PlusMailing_Nos_cambiamos.jpg','<a id=\"content-title\">gran inauguración de tyre plus 17 de agosto</a>','<p class=\"post-paragraph\" id=\"container-paragraph\">\n                            TYRE PLUS cambia de dirección a Agustín Yañez No. 2494 (entre Lope de Vega y Calderón de la Barca), Teléfono 3770 4000 <br> La inauguración será el 17 de Agosto...\n                        </p>','','','','','','','<p>TYRE PLUS cambia de dirección a Agustín Yañez No. 2494</p>\n<p>(entre Lope de Vega y Calderón de la Barca) Teléfono 3770 4000.</p>\n<p>La inauguración será el 17 de Agosto.</p>','Tyre Plus','tyre-plus','small_new_tyreplus.jpg','','','Martes 04 de Agosto de 2015','',''),
	(5,35,'Primera edición escala Expo Car Show','primer-edicion-escala-expo-car-show','','','<a  id=\"content-title\">primera edición de escala expo car show</a>\n\n','<p class=\"post-paragraph\" id=\"container-paragraph\">\n                            SyC Motors y Mitsubishi Centro presentaron el pasado Domingo 02 de Agosto del presente año, más de 4,000 autos en exhibición a escala. La Lic. Wendy  Licon, conductora de televisión y madrina del evento\n                        </p>','','','','','','','<p>\n                                SyC Motors y Mitsubishi Centro presentaron el pasado Domingo 02 de Agosto del presente año, más de 4,000 autos en exhibición a escala.\n                            </p>\n                            <p>\n                                La Lic. Wendy  Licon, conductora de televisión y madrina del evento, el Sr. Harvy Espinoza Gerente Comecial de SyC Motors  y  el Sr. Jose Antonio Barajas, organizador de la Expo, y asesor de ventas de SyC Motors, hicieron el tradicional corte de listón con lo cual queda inaugurada la Primera Edición de “ESCALA EXPO CAR SHOW”.\n                            </p>\n                            <p>\n                                Se contó con la presencia de 60 expositores miembros del Club de Hot Wheels de Occidente así como una Magisterial Conferencia “Red Line” por el Sr. Juan Miguel Alcantar;  sobre cómo iniciarse en el ámbito del coleccionismo  y  cómo conocer las líneas de este apasionante hobby que además puede ser una muy buena inversión o un excelente negocio; junto con el Sr. Miguel estuvo en el estrado el Dr. Héctor Valdez coleccionista de gran renombre representante de el Club “HWCO” (Hot Wheels Club de Occidente).\n                            </p>\n                            <p>\n                                A las más de 800 personas que asistieron y disfrutaron de esta exhibición, hicieron de este domingo un paseo familiar, gozando de un espectáculo multicolor y multidinámico, además de recibir los beneficios de nuestras los planes de financiamiento de ventas para la adquisición de su nuevos Chrysler, Dodge, Jeep, Ram y Mitsubishi.\n                            </p>\n                            <p>\n                                El comentario general de los asistentes…el evento fue muy original así como que esta clase de exposiciones nos hace recordar la historia del automóvil, el gusto por los autos y la diversidad de marcas.\n                            </p>\n                            <p>\n                                GRUPO CAMCAR agradece y extiende el más amplio reconocimiento a todos y cada uno de los participantes a esta primera edición de “ ESCALA EXPO CAR SHOW “.\n                            </p>','SYC Motors','syc-motors','small_escala_expo_car_show_600x400.jpg','','','13 de Agosto de 2015','<section class=\"\" style=\"padding: 35px 15px 15px;\">\n        <div class=\"row\">\n\n            <div class=\"col-md-4 col-sm-4 text-center\" style=\"padding: 30px 5px 0px;\">\n                <div class=\"col-md-12 col-sm-12 text-center\">\n                    <img src=\"../img/sitio/agencias/logos/logo_syc_motors_centro.png\" alt=\"LOGO SYC MOTORS\" class=\"x-img x-img-none none agn_logo\">\n                </div>\n            </div>\n            <div class=\"col-md-8 col-sm-8 text-left\" style=\"font-size: 16px; padding: 20px 5px 0px;\">\n                <div class=\"contact-method\">\n                    <i class=\"icon pe-7s-phone agn_icono\"></i>\n                    <span class=\"agn_span\">\n                        <strong>Ventas:</strong> (33) 3770-0400\n                    </span>\n                </div>\n\n                <div class=\"contact-method\">\n                    <i class=\"icon pe-7s-map-marker agn_icono\"></i>\n                    <span class=\"agn_span\">\n                        Av. 16 de Septiembre No. 651 Col. Centro, Guadalajara, Jalisco, C.P. 44180\n                    </span>\n                </div>\n\n                <div class=\"contact-method\">\n                    <i class=\"icon pe-7s-clock agn_icono\"></i>\n                    <span class=\"agn_span\">\n                        <strong>Ventas:</strong> Lunes a sábado de 9am a 7pm / Domingos de 10am a 6pm. <br>\n                        <strong>Servicio:</strong> Lunes a viernes de 8am a 7pm / Sábados de 8am a 2pm. <br>\n                        <strong>Refacciones:</strong> Lunes a viernes de 9am a 7pm / Sábados de 9am a 2pm.\n                    </span>\n                </div>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-md-12 text-center\" style=\"padding: 20px;\">\n                <a href=\"http://www.syc-motors.com.mx/\" class=\"button py4 button-transparent bg-youtube resp-button\" target=\"_blank\">\n                    <i class=\"fa fa-globe fa-fw fa-lg\"></i> SITIO WEB\n                </a>\n                <a href=\"https://www.facebook.com/SyCMotorsGdl\" class=\"button py4 button-transparent bg-facebook resp-button\" target=\"_blank\">\n                    <i class=\"fa fa-facebook fa-fw fa-lg\"></i> Facebook\n                </a>\n                <a href=\"https://twitter.com/sycmotors\" class=\"button py4 button-transparent bg-twitter resp-button\" target=\"_blank\">\n                    <i class=\"fa fa-twitter fa-fw fa-lg\"></i> Twitter\n                </a>\n            </div>\n        </div>\n    </section>','expo-car-show-1er-evento'),
	(6,18,'Creando arte con tus emociones','creando-arte-con-tus-emociones','','','<a  id=\"content-title\">lincoln, creando arte con tus emociones</a>','<p class=\"post-paragraph\" id=\"container-paragraph\">\n                            Presentamos la nueva Lincoln MKX 2016 de una manera única, invitamos a 10 personas a manejarla y sus emociones crearon una obra de arte, ve el video y descubre como.\n                        </p>','','','','','','','<p>Presentamos la nueva Lincoln MKX 2016 de una manera única, invitamos a 10 personas a manejarla y sus emociones crearon una obra de arte, ve el video y descubre como.</p>','Lincoln','lincoln','small_new_lincoln_mkx_2016_600x400.jpg','','','01 de Septiembre de 2015','<section class=\"\" style=\"padding: 35px 15px 15px;\">\n        <div class=\"row\">\n\n            <div class=\"col-md-4 col-sm-4 text-center\">\n                <img src=\"../img/sItio/agencias/logos/logo_lincoln_cavsa.png\" alt=\"LINCOLN CAVSA\" class=\"x-img x-img-none none agn_logo\">\n            </div>\n            <div class=\"col-md-8 col-sm-8 text-center\" style=\"font-size: 16px; padding: 20px 5px 0px;\">\n                <a href=\"http://lincolneurocavsa.mx/\" class=\"button py4 button-transparent bg-youtube resp-button\" target=\"_blank\">\n                    <i class=\"fa fa-globe fa-fw fa-lg\"></i> SITIO WEB\n                </a>\n                <a href=\"https://www.facebook.com/ViveLincoln\" class=\"button py4 button-transparent bg-facebook resp-button\" target=\"_blank\">\n                        <i class=\"fa fa-facebook fa-fw fa-lg\"></i> Facebook\n                </a>\n                <a href=\"https://twitter.com/ViveLincoln\" class=\"button py4 button-transparent bg-twitter resp-button\" target=\"_blank\">\n                        <i class=\"fa fa-twitter fa-fw fa-lg\"></i> Twitter\n                </a>\n            </div>\n        </div>\n    </section>',''),
	(7,17,'Apertura de nuevas instalaciones en distribuidora Jaguar Land Rover León','nueva-apertura','','','<a  id=\"content-title\">apertura de nueva agencia Jaguar Land Rover León</a>','<p class=\"post-paragraph\" id=\"container-paragraph\">\n                            Jaguar Land Rover México anuncia orgullosamente la apertura de las nuevas instalaciones de su distribuidora en León, Guanajuato.\n                        </p>','','','','','','','<p>\n                                Jaguar Land Rover México anuncia orgullosamente la apertura de las nuevas instalaciones de su distribuidora en León, Guanajuato. La agencia forma parte de la red que las marcas británicas tienen en el país e incluyen: Masaryk, Interlomas, Pedregal, Puebla, Monterrey, Guadalajara, Mérida y Culiacán.\n                            </p>\n                            <p>\n                                En la noche del pasado jueves 29 de agosto, se llevó a cabo el evento de apertura en Avenida Cerro Gordo 334-B Col. Valle del Campestre, León Guanajuato CP 37150.\n                            </p>\n                            <p>\n                                La distribuidora está construida sobre un terreno de 3,381 m2 e dentro del corredor automotriz en la Zona Dorada Comercial en una zona de gran plusvalía y desarrollo económico. Las facilidades cuentan con un taller de servicio equipado con la más moderna tecnología, además de áreas de lavado y preparado de vehículos.\n                            </p>\n                            <p>\n                                En la ceremonia de inauguración, estuvieron presentes directivos de Jaguar Land Rover León: Presidente del Consejo - Sr. Carlos Martín del Campo, Director General – Jesús Velázquez, Gerente General – Guillermo Lira.\n                            </p>\n                            <p>\n                                Por parte de Jaguar Land Rover México, asistieron: Joseph ChamaSrour - Director General, Gabriela Martínez - Coordinadora de Desarrollo de Red. Adicionalmente estuvieron presentes directivos y ejecutivos de Jaguar Land Rover Latinoamérica: Terry Hill - Presidente, Divanildo Alburquerque – Director de Desarrollo de Red, Giuliano Napolitano - Gerente de Desarrollo de Red.\n                            </p>\n                            <p>\n                                “Nuestras marcas representan el máximo lujo, distinción y exclusividad. Los autos deportivos Jaguar ofrecen un estilo incomparable y asombroso desempeño y Land Rover tiene los vehículos todo terreno más capaces, cómodos y lujosos del mundo. Todos nuestros modelos sin excepción son diseñados, desarrollados y fabricados en Inglaterra. Ofrecen la máxima distinción en estilo de vida para la gente que simplemente gusta disfrutar lo mejor de lo mejor”, comentó Joseph ChamaSrour.”\n                            </p>\n                            <p>\n                                Al evento asistieron distinguidos miembros de la sociedad leonesa, así como empresarios, clientes.\n                            </p>\n                            <p>\n                                Durante la animada celebración, la exclusiva gama de vehículos Jaguar cautivó a los invitados quienes admiraron los deportivos de lujo más diferenciados de la industria, así como las SUV’s Land Rover reconocidas como las más capaces dentro y fuera del camino y que redefinen los estándares automotrices tradicionales con máxima elegancia y estilo.\n                            </p>\n                            <p>\n                                Jaguar Land Rover Leon tiene como objetivo continuar conquistando la lealtad y preferencia de nuestros entusiastas clientes con un verdadero trato personal, compromiso a largo plazo y servicio del más alto nivel.\n                            </p>','Jaguar Land Rover León','jaguar-land-rover-leon','JLR_00-600x400.jpg','','','03 de Noviembre de 2015','<section class=\"\" style=\"padding: 35px 15px 15px;\">\n        <div class=\"row\">\n\n            <div class=\"col-md-12 col-sm-12 text-center\">\n                <h5 style=\"color: #000; text-transform: uppercase;\"><span style=\"color:#7a7a7a;\">JAGUAR LAND ROVER LEÓN</span></h5>\n                <img src=\"../img/sitio/agencias/logos/logo_jaguar_land_rover.png\" alt=\"LANDOR ROVER\" class=\"x-img x-img-none none agn_logo\">\n            </div>\n        </div>\n    </section>','apertura-nueva-agencia-jlr-leon'),
